function Get_Netstat {
	Write-Verbose "Getting Netstat"
	# Run netstat for tcp and udp
	$netstat_tcp = &{netstat -ano -p tcp}  | select -skip 4
	$netstat_udp = &{netstat -ano -p udp} | select -skip 4
	
	# Process into objects
	$netstat = @()
	foreach ($line in $netstat_tcp) { 	
		$val = -Split $line
		$l = $val[1] -Split ":" 
		$r = $val[2] -Split ":" 		
		$netstat += new-Object PSObject -Property @{
			Protocol		= $val[0] 
			Src_Address		= $l[0]
			Src_Port 		= [int]$l[1]
			Dst_Address 	= $r[0] 
			Dst_Port 		= [int]$r[1] 
			State 			= $val[3] 
			ProcessId 		= [int]$val[4]
			Check			= "Unprocessed"
		}			
	}
	foreach ($line in $netstat_udp) { 	
		$val = -Split $line
		$l = $val[1] -Split ":" 
		$netstat += new-Object PSObject -Property @{
			Protocol		= $val[0] 
			Src_Address		= $l[0]
			Src_Port 		= [int]$l[1]
			Dst_Address 	= $null
			Dst_Port 		= [int]$null 
			State 			= $null
			ProcessId 		= [int]$val[3]
			Check			= "Unprocessed"
		}
	}
	return $netstat
} #End Get_Netstat


function Get_Modules {
	Write-Verbose "Getting loaded Modules"
	# Get Modules
	$modules = Get-Process -ea 0 -Module
	$Hashes = @{}
	$ModuleList = @()
	foreach ($item in $modules) {
		if ( ($item.ModuleName -notlike "*.exe") -AND (!$Hashes.containskey($item.FileName)) ) {
			$obj = New-Object PSObject -Property @{	
				ModuleName	= $item.ModuleName
				PathName	= $item.FileName
				Company		= $item.Company
				Product		= $item.Product
				FileVersion = $item.FileVersion
				Description = $item.Description
				Check		= "Unprocessed"
				Hash		= _hash $item.FileName
			}
			$ModuleList += $obj
			$Hashes.Add($obj.PathName, 0)
		}	
	}
	return $ModuleList
} #End Get_Modules


function Get_Processes {
	Write-Verbose "Getting ProcessList"
	
	# Get Processes
	$processes = Get-WmiObject Win32_Process #| Select ParentProcessId, ProcessId, SessionId, Caption, Description, ExecutablePath, CommandLine, CreationDate;
	# Get Modules
	$processModules = get-process #| Select Id, Modules
	
	$processList = @()	
	foreach ($proc in $processes) {
		try {
			$owner = $proc.GetOwner().Domain.ToString() + "\"+ $proc.GetOwner().User.ToString()
		} catch {
			$owner = "N/A"
			Write-Warning "Owner could not be retrieved for $proc.Caption" 
		}
		$thisProcess = New-Object PSObject -Property @{
			ProcessId		= [int]$proc.ProcessId
			ParentProcessId	= [int]$proc.ParentProcessId
			SessionId		= [int]$proc.SessionId
			Name			= $proc.Caption
			Owner 			= $owner 
			PathName		= $proc.ExecutablePath
			Description		= $proc.Description
			CommandLine		= $proc.CommandLine
			Hash			= _hash $proc.ExecutablePath
			CreationDate 	= $proc.CreationDate
			ModuleList 		= @()
			Check			= "Unprocessed"
		}
		
		# Add Modules		
		foreach($item in ($processModules | where {$_.Id -eq $proc.ProcessId}).Modules) {
			if ($item.ModuleName -notlike "*.exe") { 
				$thisProcess.ModuleList += $item.ModuleName
			}
		} # End Foreach
		
		$processList += $thisProcess 
	}

	return $processList
} # End Get_Processes


function Get_ServicesRegKeys {
	Write-Verbose "Getting ServiceDriverRegKeys"
	# Getting Services from Services Registry Key
	#reg query "HKLM\System\CurrentControlSet\Services" /s | findstr "HKEY_LOCAL_MACHINE ImagePath Dll"

	$serviceRegKeys = gci HKLM:\System\CurrentControlSet\Services | foreach { 
		get-itemproperty $_.PSPath #| Select PSPath,PSChildName,DisplayName,ImagePath,Description,Group;
	}

	$Services = @()	
	$serviceRegKeys | ? { $_.ImagePath -like "exe" } | foreach {
		# Check if key is not already in hashtable and if it has parameters are looking for
		$path = _ParseCLPath $_.imagePath
		$item = New-Object PSObject -Property @{
			Key					= $_.PSPath.SubString($_.PSPath.LastIndexOf(":")+1)
			ServiceName			= $_.PSChildName
			DisplayName			= $_.DisplayName
			Description			= $_.Description
			Group 				= $_.group
			ImagePath 			= $path
			ImageHash			= _hash $path
			Check				= "Unprocessed"
			PathName 			= ''
			Hash				= ''
		}
		
		# Check if main service dll or executable exists (Imagepath is sometimes just the loader, like svchost)
		if ( ($_.DisplayName -match "^@%") -OR ($_.DisplayName -match "@C:\\") ) { 
			$path2 = _ParseCLPath ($_.DisplayName.TrimStart("@").Replace("\\","\").Substring(0,$_.DisplayName.IndexOf(",")-1)) 
			$hash2 = _hash $path2
			$item.PathName = $path2
			$item.Hash = $hash2
		}
		$Services += $item
	}
	
	return $Services;
}


function Get_Services {
	Write-Verbose "Getting ServiceList"
	
	# Get Service Information
	$services = Get-WmiObject Win32_Service #| Select Name, Caption, Description, PathName, State, Started, StartMode, ProcessId 

	$serviceList = @();	
	foreach ($svc in $services) {
		if ($svc.PathName -match "svchost.exe -k") {
			$l = "HKLM:\System\CurrentControlSet\Services\"+$svc.Name.ToString()
			$path = _ParseCLPath (get-itemproperty $l).DisplayName
		} else {
			$path = _ParseCLPath $svc.PathName
		}
		$service = New-Object PSObject -Property @{
			Name			= $svc.Name
			Caption			= $svc.Caption
			Description		= $svc.Description
			PathName		= $path
			CommandLine		= $svc.PathName
			ProcessId		= $svc.ProcessId
			State			= $svc.State
			Started			= $svc.Started
			StartMode		= $svc.StartMode
			InstallDate		= $svc.InstallDate
			Check			= "Unprocessed"
			Hash			= _hash $path
		}
		$serviceList += $service	

	}
	return $serviceList;
}


function Get_Drivers {
	Write-Verbose "Getting Drivers"
	# Get driver Information
	$drivers = Get-WmiObject Win32_SystemDriver #| Select Name, DisplayName, Description, PathName, State, Started, StartMode, ServiceType
	
	$driverList = @()
	foreach ($dvr in $drivers) { 
	#	Write-Host "in FIRST foreach: " $proc.ProcessId | ft #debug
		$path = _ParseCLPath $dvr.PathName
		$driver = New-Object PSObject -Property @{
			Name			= $dvr.Name
			DisplayName		= $dvr.DisplayName
			Description		= $dvr.Description
			PathName		= $path
			State			= $dvr.State
			Started			= $dvr.Started
			StartMode		= $dvr.StartMode
			ServiceType		= $dvr.ServiceType
			Hash			= _hash $path
			Check			= "Unprocessed"
		}	
		$driverList += $driver;
	}

	return $driverList;
}


function Get_ArmaMalfind ($ArmaPath="C:\Windows\temp\VQuery.ps1", [int]$MinSize=12,[bool]$DumpMZ=$False) {
	
	Write-Verbose "Running Arma Malfind"
	# Test if VQuery.ps1 is present in the script path
	If (!(Test-Path $ArmaPath)) { 
		Write-Error "VQuery.ps1 not found!" 
		return "Error: VQuery.ps1 not found"
		}
	
	#Perform memory scan of process memory above 12 bytes labeled Read/Write/Execute and look for MZ headers (32 bit and 64 bit systems)
	try {
#		write-warning "Running Arma..."
		$scan = &"$env:windir\system32\windowspowershell\v1.0\powershell.exe" -executionpolicy bypass -NoProfile `
					$ArmaPath -Executable -NoImages -Min $MinSize -Verbose #| Select-String -NoMatch "Powershell"
	} catch {
		Write-Warning "Scan could not be completed as dialed.  Please hang up and try again."
		return "Error: Arma"
	}#End Try

	$Arma = @()	
	#Parse scan:
	Foreach ($line in $scan) {
		$var = [string]$line | foreach{$_.Split("`t")}
		if (($var[0] -eq "PID") -OR ($var[0] -eq $null) -OR ($var[4] -notlike "*read*")) {continue}
		$Arma += new-Object PSObject -Property @{
			ProcessID	= [int]$var[0]
			Address 	= $var[1]
			Length 		= [int]$var[2]
			Type 		= $var[3]
			Protection 	= $var[4]
			PathName	= $var[5]
			ImagePath 	= $var[6]
			MemorySnip 	= $var[7]
		}
	}#End ForEach (Parser)
	
#	$Arma | Sort-Object -Property Address -Unique
	if ($DumpMZ) {
		$Arma | foreach {
			If ($_.MemorySnip -like "MZ") { 
				mkdir C:\Windows\temp\dump -force
				&"$env:windir\system32\windowspowershell\v1.0\powershell.exe" -executionpolicy bypass -NoProfile $ArmaPath -procid $_.ProcessId -DumpPath C:\Windows\temp\dump
				&"$env:windir\system32\windowspowershell\v1.0\powershell.exe" -executionpolicy bypass -NoProfile $ArmaPath -procid $_.ProcessId -GetStrings -OutFileName C:\Windows\temp\dump\strings.txt			
			}
		}
	}
	
	return $Arma | where { $_.ProcessID -ne $pid }
} #End ArmaMalfind


function Get_ArmaImageScan ($ArmaPath="C:\Windows\temp\VQuery.ps1", [int]$MinSize=40, $Modified=0.20){ 
	Write-Verbose "Running Arma Image Scan"
	
	# Test if VQuery.ps1 is present in the script path
	If (!(Test-Path $ArmaPath)) { 
		Write-Error "VQuery.ps1 not found!"
		return "Error: VQuery.ps1 not found"
	}
	
	# Get CPU bits
	$CPU = (Get-WmiObject Win32_ComputerSystem).SystemType
	
	try {
		$scan = &"$env:windir\system32\windowspowershell\v1.0\powershell.exe" -executionpolicy bypass -NoProfile `
				$ArmaPath -Executable -ImagesOnly -Min $MinSize -Mod $Modified
	} catch {
		Write-Error "Scan could not be completed as dialed.  Please hang up and try again."
		return "Error: Arma"
	}#End Try

	$Arma = @()	
	if ($scan -ne $null) {
		Foreach ($line in $scan) {
			$var = [string]$line | foreach{$_.Split("`t")}
			if (($var[0] -eq "PID") -OR ($var[0] -eq $null) -OR ($var[4] -notlike "*read*")) { continue }
			$Arma += new-Object PSObject -Property @{
				ProcessID	= [int]$var[0]
				Address 	= $var[1]
				Length 		= [int]$var[2]
				Type 		= $var[3]
				Protection	= $var[4]
				ProcessPath	= $var[5]
				PathName 	= $var[6]
				Difference 	= $var[8]
			}
		}#End ForEach (Parser)
	} #End if for null
	
	if ($CPU -like '*x64*'){
		write-Verbose "Running x64 PowerShell..."
		#	Run 32-bit Arma-light to compare disk images to memory
		try {
			$scanWoW64 = &"$env:windir\syswow64\WindowsPowerShell\v1.0\powershell.exe" -executionpolicy bypass -NoProfile `
					$ArmaPath -Executable -ImagesOnly -Min $MinSize -Mod $Modified
		} catch {
			Write-Error "Scan could not be completed as dialed.  Please hang up and try again."
		}#End Try
		
		if ($scanWoW64 -ne $null) {
			Foreach ($line2 in $scanWoW64) {
				$var = [string]$line2 | foreach{$_.Split("`t")}
				if (($var[0] -eq "PID") -OR ($var[0] -eq $null) -OR ($var[4] -notlike "*read*")) { continue }
				$Arma += new-Object PSObject -Property @{
					ProcessID	= [int]$var[0]
					Address 	= $var[1]
					Length 		= [int]$var[2]
					Type 		= $var[3]
					Protection	= $var[4]
					ProcessPath	= $var[5]
					PathName 	= $var[6]
					Difference 	= $var[8]
				}
			} #End ForEach (Parser)
		} #End if for null
	} #End if for x64
	
	Return $Arma
} # End Get_ArmaImageScan


function Get_ArmaSigCheck ($ArmaPath="C:\Windows\temp\VQuery.ps1", [int]$MinSize=100){
	Write-Verbose "Running Arma SigCheck"
	# Note: Hash is SHA-1
	
	# Test if VQuery.ps1 is present in the script path
	If (!(Test-Path $ArmaPath)) { 
		Write-Error "VQuery.ps1 not found!" 
		return "Error: VQuery.ps1 not found"
	}

	try {
		$scan = &"$env:windir\system32\windowspowershell\v1.0\powershell.exe" -executionpolicy bypass -NoProfile `
				$ArmaPath -Executable -ImagesOnly -Min $MinSize -Verify
	} catch {
		Write-Warning "Scan could not be completed as dialed.  Please hang up and try again."
		return "Error: Arma"
	}#End Try
	
	$Hashes = @{}
	$Arma = @()	
	if ($scan -ne $null) {
		Foreach ($line in $scan) {
			$var = [string]$line | foreach{$_.Split("`t")}
			if (($var[0] -eq "PID") -OR ($var[0] -eq $null) -OR ($var[4] -notlike "*read*")) {continue}

			$obj = new-Object PSObject -Property @{
				ProcessID	= [int]$var[0]
				Address 	= $var[1]
				Length 		= [int]$var[2]
				Type 		= $var[3]
				Protection	= $var[4]
				ProcessPath	= $var[5]
				PathName 	= $var[6]
				Hash 		= $var[7]
				Signature	= $var[8]
			}
			if (($obj.Hash -eq $null) -OR ($obj.Hash -eq "") ) {
				$Arma += $obj
			}
			if (!$Hashes.containskey($obj.Hash)) {
				$Hashes.Add($obj.Hash, 1)
				$Arma += $obj
			}
			
			
		}#End ForEach (Parser)
	} #End if for null
	
	return $Arma | where { $_.ProcessID -ne $pid }
}

