function Get_FileHashes($fileDirectoryArray, [bool]$executableOnly=0, [bool]$recurseDirectories=0, [int]$hashtype=0) {
	# Get Hashes of Files and Directories specified via parameters
	#
	# @param fileDirectoryArray	Array of strings representing files and/or folders to hash
	# @param executableOnly     Only check executable files (default false)  
	# @param recurseDirectories	Any directories specified should be recursively listed (default false)
	# @param hashType			Type of hashing to conduct.  0 = MD5 (default); 1 = SHA-1 (not implemented); 2 = SHA-256 (not implemented)
	#
	# @returns			procList and svcList, with hashes populated
	
    $outHashes = @()
	
	if ($hashType -ne 0) {
		write-warning "Hash type not implemented.  Defaulting to MD5";
	}
	
	foreach ($fileDirString in $fileDirectoryArray) {
		$fileDirListing = @();
		if ($recurseDirectories) {
			$fileDirListing = (gci -recurse $fileDirString);
		} else {
			$fileDirListing = (gci $fileDirString);
		}
        
		foreach ($fileOrDir in $fileDirListing) {
			
			#if directory, skip
			if ($fileOrDir.PSIsContainer) {
				continue;
			} 
			
			#else if file, get hash
			else {
                #check if hashing executables only
                # TODO (optimize) move file read from md5Hash to this function
                if ($executableOnly) {
                    $fl = [System.IO.File]::OpenRead($fileOrDir.fullname)
                    $br = new-object -typename System.IO.BinaryReader($fl);
                    $firstTwoBytes = $br.readbytes(2);
                    
                    # If doesn't start with "MZ"
                    if ($firstTwoBytes[0] -ne 77 -or $firstTwoBytes[1] -ne 90) {
                        continue;
                    }
                }
                
				$outHashes += New-Object PSObject -Property @{
					FileName		= ($fileOrDir.fullname)
					Type			= [int]0
					Value			= [string](_hash $fileOrDir.fullname $HASHTYPE 1)
					
				}	
			}
		}	
	}

	return $outHashes
}


function Get_SchTasks {
	Write-Verbose "Getting SchTasks"
	# Get scheduled tasks on system
	# Note: `at` jobs show up as task name At#, with comment of created by "NetScheduleJobAdd" function
	
	# Get Scheduled Tasks via schtasks
	$schtasks = ConvertFrom-CSV (schtasks /query /v /fo csv) | 
		where { ($_.TaskName -ne "TaskName") -AND ($_.TaskName -notlike "\Microsoft\Windows*")} | 
		Select "TaskName","Next Run Time","Status","Last Run Time","Author","Task To Run","Comment",`
		"Scheduled Task State","Run As User","Schedule Type","Start Time","Start Date",`
		"End Date","Days","Months","Repeat: Every","Repeat: Until: Time","Repeat: Until: Duration"
	
	# Get hash for any paths found
	$schtasks | foreach {
		$_ | Add-Member -type NoteProperty -name PathName -value ''
		$_ | Add-Member -type NoteProperty -name Hash -value ''
		if (($_."Task To Run" -match "exe|dll|sys") -AND ($_."Task To Run" -match "\\")) {
			$path = _ParseCLPath $_."Task To Run"
			$_.PathName = $path
			$_.Hash = _hash $path
		} # End If
	} # End foreach
	
	return $schtasks
} # End Get_SchTasks


