function Get_Autostarts {

	# Get Startups from wmi
	$Startups = @()
	$Startup = gwmi Win32_StartupCommand
	$Startup | foreach {
		$path = _ParseCLPath $_.Command
		if ($path.count -gt 1) {
			Write-Verbose "Multiple pathes found in Startups"
			$path = $path[1]
		}
		$Startups += new-Object PSObject -Property @{
				Key 		= $_.Location
				Caption		= $_.Caption
				User		= $_.User
				CommandLine = $_.Command
				PathName 	= $path
				Hash		= _hash $path
			}
	}
	
	# Pending File Rename Operations
	$PendingFileRename = (get-itemproperty "HKLM:\System\CurrentControlSet\Control\Session Manager").PendingFileRenameOperations
	# Get items in the Start up and task folders
	$startupfolder = @()
	#	'[-] Getting Startup Programs (All_Users)'
	$startupfolder += gci -Force -Recurse "$env:ALLUSERSPROFILE\Start Menu\Programs\Startup\" | where {$_.FullName -notlike "*.ini"} | Select FullName, Length, CreationTime
	#	'[-] Getting All Users Start up (Vista Plus)'
	$startupfolder += gci -Force -Recurse "$env:ALLUSERSPROFILE\Microsoft\Windows\Start Menu\Programs\Startup\" | where {$_.FullName -notlike "*.ini"}  | Select FullName, Length, CreationTime
	#	'=============== Surveying Startup Programs (Userprofile)======'
	$startupfolder += gci -Force -Recurse "C:\Users\*\Start Menu\Programs\Startup\" | where {$_.FullName -notlike "*.ini"} | Select FullName, Length, CreationTime
	#	'=============== Surveying C:\Windows\Tasks ==================='
	$startupfolder += gci -Force -Recurse "$env:windir\Tasks" | where {$_.FullName -notlike "*.ini"} | Select FullName, Length, CreationTime

	# Get Appinit_dlls
	$Appinit_dlls = @()
	if ((get-itemproperty -ea 0 "HKLM:\SOFTWARE\Microsoft\Windows NT\CurrentVersion\Windows").Appinit_Dlls) {
		$Appinit_dlls += new-Object PSObject -Property @{
			Key				= "HKLM:\SOFTWARE\Microsoft\Windows NT\CurrentVersion\Windows"
			PathName		= (get-itemproperty -ea 0 "HKLM:\SOFTWARE\Microsoft\Windows NT\CurrentVersion\Windows").Appinit_Dlls
			Hash			= _hash ((get-itemproperty -ea 0 "HKLM:\SOFTWARE\Microsoft\Windows NT\CurrentVersion\Windows").Appinit_Dlls)
		}
	}
	if ((get-itemproperty -ea 0 "HKLM:\SOFTWARE\Wow6432Node\Microsoft\Windows NT\CurrentVersion\Windows").Appinit_Dlls) {
	$Appinit_dlls += new-Object PSObject -Property @{
		PathName		= (get-itemproperty -ea 0 "HKLM:\SOFTWARE\Wow6432Node\Microsoft\Windows NT\CurrentVersion\Windows").Appinit_Dlls
		Hash			= _hash ((get-itemproperty -ea 0 "HKLM:\SOFTWARE\Wow6432Node\Microsoft\Windows NT\CurrentVersion\Windows").Appinit_Dlls)
		}			
	}
	
	# Get Known Dlls
	$knowndlls = @()
	Get-ItemProperty -ea 0 -Path "Registry::HKLM\System\CurrentControlSet\Control\Session Manager\KnownDlls" | Out-String -Stream | Select-String -SimpleMatch ".dll" | foreach { ($_ -split ":")[1]} | foreach { 
		$knowndlls += new-Object PSObject -Property @{
			PathName		= "$env:windir\System32\" + [string]$_.Trim()
			Hash			= _hash ("$env:windir\System32\" + [string]$_.Trim())
			}
		}
	
	# Get null session pipes
	$nullSessionPipes = (Get-ItemProperty -ea 0 HKLM:\SYSTEM\CurrentControlSet\Services\lanmanserver\parameters).nullsessionpipes
		
	$startup = new-Object PSObject -Property @{
		Startups			= $Startups
		StartupFolders		= $startupfolder
		Appinit_dlls		= $Appinit_dlls
		Known_dlls			= $knowndlls
		NullSessionPipes 	= $nullSessionPipes
		}
		
	return $startup
}


