#region Helper Functions:
function _hash ([string]$inputStr, $Provider=$HashProvider, [int]$inputType=1) {
	# Perform MD5 hash on item
	#
	# @param input		Input to hash
	# @param Provider	Type of hashing to conduct.  MD5 (Default); SHA-1;
	# @param inputType	Type of input.  0 = string ; 1 = file name (Default)
	#
	# @returns			[string] hash of input, uppercase hex without byte group delimiters
	
	
	if ($inputType -eq 1) {
		if (($inputStr -eq '') -or ($inputStr -eq $null)) {
			Write-Error "Hash Error: Input String was Null or Empty"
			return $null;
		}
        try {
			$inputBytes = [System.IO.File]::ReadAllBytes($inputStr);
	    } catch {
			Write-Error "String: $inputStr"
			Write-Error "Hash Error: Could not read raw bytes of file"
			return $null;  
        }
    } else {
		try {
			$inputBytes = [System.Text.Encoding]::UTF8.GetBytes($inputStr);
	    } catch {
			Write-Error "Hash Error: Could not convert string to bytes"
			Write-Error "String: $inputStr"
			return $null;  
        }
	}
	try {
		$result2 = [System.BitConverter]::ToString($Provider.ComputeHash($inputBytes))
		$result = $result2.Replace('-','').ToUpper()
	} catch {
		Write-Error "String: $inputStr"
		Write-Error "Hash Error: Could not compute Hash"
		return $null; 		
	}
	return $result;
}


function _ParseCLPath ([string]$inputStr) {
	# PathName extractor
	#[regex]$pathpattern = '(\b[a-z]:\\(?# Drive)(?:[^\\/:*?"<>|\r\n]+\\)*)(?# Folder)([^\\/:*?"<>|\r\n,\s]*)(?# File)'
	#[regex]$pathpattern = "((?:(?:%\w+%\\)|(?:[a-z]:\\)){1}(?:[^\\/:*?""<>|\r\n]+\\)*[^\\/:*?""<>|\r\n]*\.(?:exe|dll|sys))"
	
	#Check for paths with no drive letter:
	$str = $inputStr.ToLower()
	
	if ($str -match "%systemroot%") {
		$str = $str.Replace("%systemroot%", "$env:SystemRoot")
	}
	if ($str -match "%programfiles%") {
		$str = $str.Replace("%programfiles%", "$env:programfiles")
	}
	if ($str -match "%windir%") {
		$str = $str.Replace("%windir%", "$env:windir")
	}	
	if ($str -match "\\systemroot") {
		$str = $str.Replace("\systemroot", "$env:SystemRoot")
	}
	if ($str.StartsWith("system32")) {
		$str = $env:windir + "\" + $str
	}
	if ($str.StartsWith("syswow64")) {
		$str = $env:windir + "\" + $str
	}
	if ($str -match "@\w+\.dll,") {
		$str = $env:windir + "\system32\" + $str.Split(",")[0].Substring(1)
	}	
	
	# Match Regex of File Path
	$regex = '(\b[a-z]:\\(?# Drive)(?:[^\\/:*?"<>|\r\n]+\\)*)(?# Folder)([^\\/:*?"<>|\r\n,\s]*)(?# File)'
	$matches = $str | select-string -Pattern $regex -AllMatches | % { $_.Matches } | % { $_.Value }
	
	if ($matches.count -gt 1) {
		Write-Verbose multiple paths found $matches
		return $matches[1]
	} else {
		return $matches
	}
	# Write-Verbose "Matches: $str --> $matches"
}


function _ParseCLPathOLD ([string]$inputStr) {
	# Parse PathName from Command Line arguements
	# @param inputStr	Input to Parse
	# @returns			[string] PathName with no parameter
	
	# Parse out PathName from CommandLine
	if ($inputStr[0] -eq '"') {  #starts with quote
		$i = $inputStr.indexof('"',1);  #Find Closing quote
		$pathname = $inputStr.substring(1,($i-1));
	} else {  #doesnt start with quote
		$i = $inputStr.indexof(' ');  #generally ends at first space

		if ($i -lt 0) { #commandline has no arguments and path has no spaces
			$pathname = $inputStr;
		} else { # non quoted path with spaces in it - parse out command line parameters starting with - or /
			$val = $inputStr -Split " -"
			if ($val[0] -Match " /") { $val = $val[0] -Split " /"}
			$pathname = $val[0]
		}	
	}
	
	#Check for paths with no drive letter:
	if ($pathname.ToLower() -match "%systemroot%") {
		$pathname = $pathname.ToLower().Replace("%systemroot%", "$env:SystemRoot")
	}
	if ($pathname.ToLower() -match "%programfiles%") {
		$pathname = $pathname.ToLower().Replace("%programfiles%", "$env:programfiles")
	}
	if ($pathname.ToLower() -match "%windir%") {
		$pathname = $pathname.ToLower().Replace("%windir%", "$env:windir")
	}	
	if ($pathname.ToLower().StartsWith("\??\")) {
		$pathname = $pathname.Substring(4)
	}
	if ($pathname.ToLower().StartsWith("system32")) {
		$pathname = $env:windir + "\" + $pathname
	}
	if ($pathname.ToLower().StartsWith("\systemroot") ) {
		$pathname = $pathname.ToLower().Replace("\systemroot", "$env:SystemRoot")
	}
	if ($pathname.ToLower().StartsWith("syswow64") ) {
		$pathname = $env:SystemRoot + "\" + $pathname
	}
	
	return $pathname
}


